import React, { useEffect } from "react";

import Card from "../Card";

function Media(props) {
  return (
    <Card title="Média dos Números" green>
      <div className="Intervalo">
        <span>
          <span>Resultado: </span>
          <strong>10</strong>
        </span>
      </div>
    </Card>
  );
}

export default Media;
